import Banner from "./components/Banner";
import { useState } from "react";
import MainScreen from "./screens/MainScreen";
import { SESSION } from "./constants/AppConstants";

const App = () => {
  const [token, setToken] = useState(SESSION.LOGGED_OUT);
  const isLoggedIn =
    token == SESSION.LOGGED_OUT || token !== SESSION.TOKEN_FAILURE;

  const AccountNumber = () => {
    if (isLoggedIn) {
      return <p>Account Number: {token}</p>;
    }
  };

  return (
    <div className="App">
      <Banner />
      <AccountNumber />
      <MainScreen isLoggedIn={isLoggedIn} token={token} setToken={setToken} />
    </div>
  );
};

export default App;
